import React from 'react';

export default class Filters extends React.Component {
    constructor(props) {
        super(props);

        this.callback = props.callback;

        this.state = {
            filters: {
                subjects:    {},
                courses:     {},
                instructors: {},
                rooms:       {},
                times:       {},
                days:        {}
            }
        };
    }

    prepareFilters() {
        this.callback('hi');
    }

    render() {
        return (
            <>
                <div className="cs-filters-wrapper">
                    <button onClick={() => this.prepareFilters()}>Apply</button>
                </div>
            </>
        );
    }
}
